class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        for i in t:
            if len(s) != 0:
                if i == s[0]:
                    s = s[1:]
        print(f's_sisa: {s}')
        return len(s) == 0


if __name__ == '__main__':
    test = Solution()

    t = ""
    s = "leeeeetcode"
    # output = true

    s1 = "abc"
    t1 = "ahbgdc"
    # output = true

    s2 = "axc"
    t2 = "ahbgdc"
    # output = false

    s3 = ""
    t3 = "ahbgdc"
    # output = true

    s4 = "ab"
    t4 = "baab"
    # output = true

    print(test.isSubsequence(s, t))
    print(test.isSubsequence(s1, t1))
    print(test.isSubsequence(s2, t2))
    print(test.isSubsequence(s3, t3))
    print(test.isSubsequence(s4, t4))
